import ItemLink from "../shared/components/ItemLink"

const FooterTop = () => {

    const navigationFirstLinkList = [
        {
            href: "link",
            content: "Компания"
        },
        {
            href: "link",
            content: "Новости"
        },
        {
            href: "link",
            content: "Каталог"
        },
        {
            href: "link",
            content: "Доставка"
        },
        {
            href: "link",
            content: "Контакты"
        },
    ]

    const navigationSecondaryLinkList = [
        {
            href: "link",
            content: "Материалы"
        },
        {
            href: "link",
            content: "Техника"
        },
        {
            href: "link",
            content: "Инструмент"
        },
        {
            href: "link",
            content: "Спецпредложения"
        },
    ]

    return (
        <div className="footer-top">
            <div className="container">
                <div className="footer-top-inner">
                    <div className="footer-top__left">
                        <a className="company-name" href="link">Техномарт</a>
                        <p className="footer-adrees-desc">г. Санкт-Петербург, ул. Б.Конюшенная, д. 19/8<br />+7(812)
                            555-05-55</p>
                    </div>
                    <div className="footer-navigation">
                        <ul className="footer-navigation__first">
                            {navigationFirstLinkList.map((item) => <ItemLink className={"navigation-first__link"} href={item.href} content={item.content}></ItemLink>)}
                        </ul>
                        <ul className="footer-navigation__secondary">
                            {navigationSecondaryLinkList.map((item) => <ItemLink classNameLink={"navigation-secondary__link"} href={item.href} content={item.content}></ItemLink>)}
                        </ul>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default FooterTop
